////componente para generar un pdf con los resultados de la consulta//////
import jsPDF from 'jspdf';
import 'jspdf-autotable';

const generatePDF = (data, punto) => {
  // Crea una nueva instancia de jsPDF
  const pdf = new jsPDF({
    format: 'letter',
  });

  // Obtiene la fecha actual
  const currentDate = new Date();
  const dateString = currentDate.toLocaleDateString(); // Formato local de la fecha

  // formato de una imagen en formato Base64 ///////////////
   const imageBase64 = 'data:image/png;base64,';

   /// adiciona la  imagen el el pdf ////////////////////////
  pdf.addImage(imageBase64, 'JPEG', 20, 8, 33, 33);

  //texto para adicionar al pdf ///////////////////
  const texto1 = 'REPORTE DE INFORMACION';
  const texto2 = 'CONSULTA TEMATICA PLAN DE ORDENAMIENTO TERITORIAL';
  const texto2m = 'MUNICIPIO DE MONTERIA';
  const texto3= 'RESULTADO DE LA CONSULTA';

  /// Calcula el ancho del texto
  const textWidth2 = pdf.getTextWidth(texto2);
  const textWidth3 = pdf.getTextWidth(texto3);

  // Calcula la posición `x` para centrar el texto
  const pageWidth = pdf.internal.pageSize.getWidth();
  const x1 = (pageWidth - textWidth3) / 2;
  //const x2 = (pageWidth - textWidth2) / 2;
  //console.log (pageWidth)
  //console.log (textWidth2)
   // Line width in units (you can adjust this)
   //pdf.setLineWidth(2);

   pdf.setFontSize(8);
   pdf.setFont('custom', 'bold');
   pdf.text(texto1, 98, 30);
   pdf.text(texto2, 72, 33);
   pdf.text(texto2m, 100, 36);
   
   /// Inserta una línea horizontal debajo del texto
  pdf.setLineWidth(0.5);
  pdf.line(20, 42, pageWidth - 20, 42); // (x1, y1, x2, y2)

  pdf.text("Fecha de Elaboracion:", 20,50)
  pdf.text(dateString, 50, 50)
  console.log("GONORREA")
  pdf.text('Latitud', 20, 55)
  pdf.text(punto.latitud.toString(), 50, 55)
  pdf.text('Longitud', 20, 60)
  pdf.text(punto.longitud.toString(), 50, 60)

  // Agrega un título en las cordenadas 20,20
  pdf.text('RESULTADO DE LA CONSULTA', x1, 70);
  pdf.setFont('custom', 'normal');


  // Define las columnas y filas para la tabla
  const columns = ['Atributo', 'Valor'];
  const rows = [];

  // Convierte el JSON a un formato que jspdf-autotable pueda usar
  for (const key in data) {
    if (data.hasOwnProperty(key)) {
      rows.push([key, data[key]]);
    }
  }
  
  // Agrega la tabla al documento
  pdf.autoTable({
    head: [columns],
    body: rows,
    startY: 80,
  });

  // Guarda el PDF
  pdf.save('resultados_consulta.pdf');
};
export default generatePDF